import React, { Component } from 'react';
import Navigation from '../Navigation/Navigation';

class Main extends Component {
    constructor(props) {
        super(props);
        this.state = {
          isOpen: false
        };
        this.toggle = this.toggle.bind(this);
      }

    toggle() {
        this.setState({
            isOpen: !this.state.isOpen
        });
    }

    render() {
        return (
            <div className="Main">
                <Navigation />
            </div>
        );
    }
}

export default Main;
